  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	id: 'doc10',
	title: 'Getting help and contributing'
};
export const metadata = {
  "unversionedId": "doc10",
  "id": "doc10",
  "isDocsHomePage": false,
  "title": "Getting help and contributing",
  "description": "This project has a non-fixed release cycle but we will be making bug fixes in response to user feedback and adding features. Please let us know if you encounter a bug by filing an issue. Github issues is also the right place to ask questions about using the code.",
  "source": "@site/docs/doc10.md",
  "permalink": "/docs/doc10",
  "editUrl": "https://github.com/facebook/docusaurus/edit/master/website/docs/doc10.md",
  "sidebar": "someSidebar",
  "previous": {
    "title": "Outputs and diagnostics",
    "permalink": "/docs/doc9"
  }
};
  /* @jsx mdx */

export const rightToc = [];

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`This project has a non-fixed release cycle but we will be making bug fixes in response to user feedback and adding features. Please let us know if you encounter a bug by filing an issue. Github issues is also the right place to ask questions about using the code.`}</p>
    <p>{`We appreciate all contributions. If you plan to contribute new features or extensions to the core, please first open an issue and discuss the feature with us. `}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
